    "placeType": "museum",
    "description": "Всё время своего существования колония была убыточной для Российско-Американской компании. К середине 1820-х годов местная популяция морской выдры сильно сократилась, на промысел зверя в калифорнийских водах местные власти шли неохотно. Сельское хозяйство в прибрежной зоне страдало от климатических условий, а вглубь континента РАК продвигаться не решалась. В 1830-х годах русские продвинулись на юг от Росса создав три фермы-«ранчи» (село Костромитиновское, ранча Черных, ранча Хлебниковские равнины), увеличив сельскохозяйственное производство, которое, однако, по-прежнему не покрывало расходов на содержание колонии. После соглашения Российско-Американской компании и Компании Гудзонова залива о регулярном снабжении последней русских колоний продовольствием по твёрдым ценам надобность в поставках продовольствия из поселения Росс и мексиканской Калифорнии отпала.\n\nВ 1839 году Российско-Американская компания приняла решение оставить крепость Росс и продать её. Компания Гудзонова залива не заинтересовалась предложенной ей сделкой. Правительство Мексики, продолжавшее считать землю под Россом своей, не пожелало платить за неё, ожидая, что русские просто забросят колонию. Наконец, в 1841 году крепость Росс была продана американскому предпринимателю Джону Саттеру, основателю поселения Новая Гельвеция, владевшему почти 200 км² земли в её окрестностях, за 42 857 руб. серебром. В счёт оплаты Саттер поставлял на Аляску пшеницу, но, по свидетельству П. Головина, так и недоплатил почти 37,5 тыс. руб. Однако по информации, имеющейся у Альберта Уртадо, опубликовавшего в начале XXI века биографию Саттера, большая часть долга была выплачена 13 апреля 1849 года агентом Саттера Питером Бернеттом (англ. Peter Burnett). Сумма в размере 19 778 долларов США была передана им агенту Российско-Американской компании Уильяму Стьюарту (англ. William M. Steuart) в виде «банкнот и золота» (англ. notes and gold). После этого, по словам Уртадо, долг Саттера перед компанией был исчерпан.\n\nСаттер сам не жил в Форт-Россе, назначая туда наёмных управляющих. Последним управляющим был Вильям Бенитц (William Benitz), который, в конечном счёте, стал арендовать форт у Саттера. Он в несколько раз увеличил старый русский сад, расширил дом Ротчева (все пристройки были удалены в 1926 году), где и жил с 1846 года, построил причал. В 1867 году Бенитц разделил свои владения на две части и продал их разным покупателям. Форт отошёл к Джеймсу Диксону (James Dixon). В 1873 году Джордж Колл (George W. Call) выкупил форт за $35 000 и поселился здесь с семьёй, превратив его в небольшой интенсивно используемый порт. Тогда же бывшая русская колония начинает привлекать первых туристов.\n\nВ 1903 году Колл продал форт Калифорнийской лиге исторических объектов (California Historical Landmarks League), которая в 1906 году перепродала его штату Калифорния. Всего через месяц произошло сильнейшее землетрясение, разрушившее форт. К 1916 году он был восстановлен с использованием сохранившихся деталей оригинальных зданий.\n\n5 октября 1970 года в форте произошёл пожар, полностью уничтоживший часовню (реконструирована в 1973 году). Через несколько месяцев после этого сгорела крыша дома Ротчева."
