  {
    "id": 135,
    "lat": 55.99385,
    "lng": 37.628433,
    "name": "Церковь Рождества Христова в Осташково",
    "urls": [
      "https://avatars.mds.yandex.net/get-altay/216588/2a0000015b17041739c552700a6c55c44efa/XXXL",
      "https://avatars.mds.yandex.net/get-altay/1001354/2a000001628779ca958d1535c62230c2340b/XXXL",
      "https://avatars.mds.yandex.net/get-altay/905403/2a000001628779b2cd8df02931a0b48e8847/XXXL",
      "https://avatars.mds.yandex.net/get-altay/1020917/2a000001628779c790eca9b964ec05955039/XXXL"
    ],
    "placeType": "other",
    "description": "Осташковский храм был и остается красивейшим сооружением в окрестностях Мытищ. В нем гармонично слились черты разных архитектурных стилей, иконописи, стенной росписи, декоративного убранства. Выполненные с любовью и тщанием, разностилевые элементы не противоречат друг другу, а дополняют и обогащают друг друга. По осташковской церкви можно проследить, как развивалась русская церковная архитектура на протяжении четырех столетий. Мощные стены храма восходят к русско-византийскому стилю. Ампирная колокольня рядом с ними кажется особенно легкой и ажурной. Иконы главного иконостаса, написанные в манере, характерной для XVIII века, обрамлены резными рамами под русскую старину. Стенные росписи начала XX века напоминают о сказочно-былинном стиле В.М. Васнецова. Рядом с ними — резные ограждения алтарей и скамьи начала XXI века, также напоминающие о былинной Руси. Все это сливается в единый художественно-исторический ансамбль и создает очень интересный и привлекательный образ старинного, но не устаревшего храма."
  },
