    "placeType": "hotel",
    "description": "Гостинично — развлекательный комплекс «Малибу» расположен на берегу Пироговского водохранилища, в давно излюбленном месте отдыха москвичей Бухте Радости, в получасе комфортной езды от Москвы по Осташковскому шоссе. Отличительная особенность комплекса — роскошная стилизации в тропическом и историческом стиле в архитектуре и интерьерах. Изюминка комплекса настоящий пиратский фрегат «Черная Жемчужина». Вся мебель и декоративные элементы оформления комплекса – результат ручной работы, ростовые куклы пиратов выполнены по индивидуальному заказу. ГРК «Малибу» соответствует всем требованиям современного гостя – комфорт, гостеприимство, сервис – все, как на лучших мировых курортах."
