    "placeType": "museum",
    "description": "Единственный в мире музей подносов находится в Жостово. Здесь можно узнать историю развития промысла, и расписать поднос под руководством художника. Каждое изделие на мануфактуре — единственное в своем роде, уникально, другого такого нет, приобретая что-то из коллекции будьте уверены — у вас единственный экземпляр. Цветы и не только здесь расписывают с 1825 года. Жостовский букет - самый яркий символ народного современного искусства. в этом году этому промыслу — 195 лет! Первые подносы были из папье маше в 1800е, 1825 году Братья Вишняковы основывают свои мастерские, а уже в 1839 году впервые упоминаются металлические подносы. В наше время даже поднос делается вручную — как бы на странно это звучало, поэтому поднос на фабрике рождается с нуля, с листа металла и дальше превращается в произведение искусства!"
