    "placeType": "park",
    "description": "Клязьминское водохранилище — один из крупнейших искусственных водоемов Подмосковья, расположенный к северу от столицы. Оно было образовано в 1937 в результате строительства на реке Клязьма Пироговского гидроузла. Его задачей было обеспечение устойчивого водоснабжения Москвы, а также регулирование уровня воды в Москве-реке и Клязьме. В настоящее время водохранилище является частью общей гидросистемы канала имени Москвы (соединено с Пяловским и Химкинским водохранилищем, включает в себя Пироговское водохранилище), протянувшейся по территории городского округа Химки и городского округа Мытищи. Полезный объем Клязьминского водохранилища — 27 млн куб.м, площадь — 16,2 кв.км. Ширина — до 1,2 км, длина — 16 км, глубина — до 16 м (средняя — 5,5 м)."
