  {
    "id": 250,
    "lat": 43.9,
    "lng": 42.717,
    "name": "Нарзанная галерея",
    "urls": [
      "http://getpin.ru/etfiles/VisitPointImagesFiles/wJvA1EPjib1LflCu2d9dls-2019-09-04%2014_14_58.jpg",
      "https://badgeonline.ru/uploads/narzannay_galereia_5.jpg"
    ],
    "placeType": "museum",
    "description": "Нарзанная галерея — памятник архитектуры XIX века, расположенный в курортном парке города Кисловодска. Для строительства Нарзанной галереи М. С. Воронцовым был приглашен английский архитектор С. И. Уптон. По его замыслу здание должно было объединить под одной крышей источник, галерею и купальни. В 1851 году на месте прежнего деревянного каптажа архитектор создал новый каменный бассейн. Галерея была построена в стиле «готического романтизма», и по своей форме напоминала замочную скважину, в центре которой расположился «ключ» — источник Нарзана. Фасады здания украшены арками и пирамидальными башенками. Строительство было завершено в 1853 году. Галерея сохранилась до настоящего времени в первозданном виде, претерпев лишь незначительные изменения в убранстве интерьера."
  },
