    "placeType": "other",
    "description": "Страусиная ферма расположена в получасе езды от Москвы. Наша экоферма  - это настоящий кладезь развлечений. Главное из них - экскурсия на страусиную ферму, которая понравится взрослым и детям. Ферма страусов - это контактная ферма, где можно окунуться в атмосферу фермерского уклада и купить свежие натуральные продукты. Здесь вы сможете посмотреть и покормить взрослых страусов и страусов-малышей, увидеть и подержать страусиные яйца. Понаблюдать за поведением страусов, посмотреть как они быстро бегают, выпрашивают еду, защищают свою территорию, ухаживают за самкой."
