    ],
    "placeType": "monument",
    "description": "На южном склоне Крепостной скалы, проспекте Карла Маркса в г. Ставрополе, стоит памятник великому писателю А.С. Пушкину. Установили памятник в 1987 г., в честь 150 летия со смерти писателя. Место расположения памятника выбрано не случайно, напротив когда-то была почтовая станция, в ней поэт отмечал свою подорожную. К слову сказать, Ставрополь Пушкин посещал дважды в 1820 и 1829 годах. Авторами композиции были архитектор Ю.И.Тихонов и скульптор Э.М.Ладыгин. Памятник был создан на Мытищинском заводе художественного литья. Монумент представляет собою бронзовую фигуру писателя на мраморном постаменте. Поэт Пушкин сидит на стуле, с задумчивым видом."
