  {
    "id": 37,
    "lat": 48.540781,
    "lng": 135.013038,
    "name": "Музей Амурского моста",
    "urls": [
      "https://upload.wikimedia.org/wikipedia/commons/thumb/7/70/Museum_of_amur_bridge.jpg/1920px-Museum_of_amur_bridge.jpg"
    ],
    "placeType": "museum",
    "description": "Итак, мы можем подвести итог, что современные технологии, и компьютеры в частности, имеют как положительные, так и отрицательные последствия для жизни людей. А для того, чтобы жить в гармонии люди должны найти правильный баланс. Они должны помнить, что компьютер изначально был создан, чтобы помочь людям, сделать их жизнь легче, а не разрушить ее.\n\nКомпьютеры коренным образом изменили жизнь каждого человека. Несколько десятилетий назад люди даже не знали ничего об этих электронных устройствах, тогда как в наши дни даже маленький ребенок может управлять этой машиной. Почти все современные технологии зависит от компьютеров, которые используются для хранения данных: файлов, секретной информации, банковских операций и прочего.\n\nМногие люди, работа которых связана с компьютерами жалуются на проблемы со здоровьем, такие как головная боль, заболевания кисти, боли в спине, плохое зрение. Кроме того, проводя много времени за компьютером, начинаем чрезмерно питаться, что в свою очередь приводит к ожирению."
  },
  {
    "id": 251,
    "lat": 45.049584,
    "lng": 41.973962,
    "name": "Памятник Солдату-красногвардейцу",
    "urls": [
      "https://regnum.ru/uploads/pictures/news/2019/06/15/regnum_picture_1560596864137525_normal.jpeg",
      "https://img.lookmytrips.com/images/look7162/5c74ec2eff9367026b096a82-5c97a0ae711cf-1e9f85e-lbcvr.jpg",
      "http://www.travel4us.ru/Russia/Stavropol/Red_Army_man/Stavropol_soldier.jpg"
    ],
    "placeType": "monument",
    "description": "Памятник, установленный в ознаменование пятидесятилетия освобождения Ставрополя от белогвардейцев, — это один из самых узнаваемых и знаменитых символов города Ставрополь. Ставропольцы называют этот монумент просто «Буденовец», «Красноармеец» или «Солдат», иногда можно услышать название «Железный Человек», но чаще его ласково называют «Алеша». Огромный Буденовец (высота памятника — примерно семь с половиной метров) расположен в историческом центре города — на площади Крепостной горы, на так называемой «Воздушной набережной». Открытое свободное пространство вокруг монумента придает ему еще больше величия."
  },
  {
    "id": 252,
    "lat": 45.0498149,
    "lng": 41.978898,
    "name": "Казанский кафедральный собор",
    "urls": [
