      "https://c1.35photo.pro/photos_series/1479/1479659.jpg",
      "https://c1.35photo.pro/photos_series/1479/1479662.jpg"
    ],
    "placeType": "temple",
    "description": "В XIX - начале XX века Казанский собор, строительство которого велось 25 лет, являлся центром духовной, культурной, общественной жизни не только города, но и всей губернии. Почти 100-метровую звонницу было видно за десятки верст. А звон колоколов, один из которых имел массу почти 600 пудов (9,5 тонн) хорошо слышали во всей округе. Решение о восстановлении разрушенного храма было принято в 1992 году. Воссоздать первоначальный образ помогли материалы историков и работников музея. Долгие годы шла реставрация самого собора. В 2010 году в нем прошла первая служба. А в 2012 году его освятил Патриарх Кирилл. Храм строили всем миром, не только за счет бюджетных средств, но и на средства бизнесменов и меценатов, а также на пожертвования неравнодушных людей."
  },
