    "placeType": "theatre",
    "description": "Театр драмы расположен на площади Ленина в здании с массивными колоннами. Культурная жизнь Ставрополя от его основания до открытия театра была очень активной. В то время путь на Кавказ, который служил местом ссылки неугодных самодержавию людей, проходил через Ставрополь. Дважды наш город посещали А.С. Пушкин и М.Ю. Лермонтов. Проездом в Тегеран останавливался А. С. Грибоедов. Дух декабристов витал над Кавказом, в Ставрополе побывали: А. И. Одоевский, Н. А. Назимов, В.Н. Лихарев М. М. Нарышкин, Н.И. Лорер и др. Присутствие в разное время людей прогрессивных взглядов влияло на развитие культуры, поэтому в городе так быстро возник театр, ибо во все времена именно он является мерилом культурного уровня города."
