    "id": 302,
    "lat": 57.81630861594191,
    "lng": 28.334959760949726,
    "name": "Памятник княгине Ольге",
    "urls": [
      "https://test-backend-flutter.surfstudio.ru/files/1642445092756.jpg",
      "https://test-backend-flutter.surfstudio.ru/files/1642445092923.jpg"
    ],
    "placeType": "monument",
    "description": "Памятник Княгине Ольге — работа скульптора Вячеслава Клыкова, открытие приурочено к дню празднования 1100-летия первого упоминания Пскова в летописи.\n\nПамятник установлен в Детском парке. Представляет собой бронзовую фигуру княгини с мальчиком — внуком князем Владимиром, держащим в руках икону с ликом Христа. В правой руке у Ольги крест — символ Православия; лик княгини увенчан нимбом.\n\nПамятник стоит на цилиндрическом постаменте из белого камня с барельефами 12 псковских и российских святых: псковские князья Довмонт-Тимофей и Всеволод-Гавриил, князь Александр Невский, преподобные Никандр Псковский, Марфа Псковская и Васса Псково-Печерская, святитель Тихон (Патриарх Московский и всея России), Корнилий Псково-Печерский, митрополит Вениамин, Великая княгиня Елизавета Фёдоровна и блаженный Николай Салос.\n\nАвтор памятника — скульптор Вячеслав Клыков. Высота скульптуры и постамента по 4,20 метра."
  },
  {
    "id": 303,
    "lat": 57.822065226722266,
    "lng": 28.329043313472265,
    "name": "Троицкий собор (Псков)",
    "urls": [
      "https://test-backend-flutter.surfstudio.ru/files/1642445487482.jpg",
      "https://test-backend-flutter.surfstudio.ru/files/1642445487619.jpg",
      "https://test-backend-flutter.surfstudio.ru/files/1642445487782.jpg",
      "https://test-backend-flutter.surfstudio.ru/files/1642445487949.jpg",
      "https://test-backend-flutter.surfstudio.ru/files/1642445488139.jpg"
    ],
    "placeType": "temple",
    "description": "Свято-Троицкий собор — православный храм во Пскове, кафедральный собор Псковской митрополии. Входит в состав архитектурного ансамбля Псковского крома и является главным его строением.\n\nСегодняшнее, четвёртое по счёту, здание собора было построено в 1699 году, на том же месте, где стояли предыдущие храмы. Первый собор, построенный в X веке по распоряжению княгини Ольги, был деревянным и простоял до первой половины XII века, когда был уничтожен пожаром. Второй собор был уже каменным и заложен, по церковному преданию, в 1138 году святым благоверным князем Всеволодом Мстиславичем (по исследованиям Николая Воронина, Павла Раппопорта и Юрия Спегальского — в конце 1180-х — начале 1190-х годов). В 1363 году произошло обрушение свода храма, и в 1365 году на старом основании заложен новый собор. В 1609 году во время сильного пожара в соборе всё сгорело, кроме гробницы святого князя Довмонта и мощей святого князя Всеволода. Храм был исправлен и так простоял до 1682 года, когда на его месте было начато строительство нового каменного собора на старой основе. В 1699 году было завершено строительство четвёртого собора, дошедшего до наших дней."
  },
