    "placeType": "museum",
    "description": "Оружейная палата — музей-сокровищница — является частью комплекса Большого Кремлевского дворца. Она размещается в здании, построенном в 1851 году архитектором Константином Тоном. Основу музейного собрания составили веками хранившиеся в царской казне и патриаршей ризнице драгоценные предметы, выполненные в кремлевских мастерских, а также полученные в дар от посольств иностранных государств. Своим названием музей обязан одному из древнейших кремлевских казнохранилищ.\n\nОружейная палата хранит древние государственные регалии, парадную царскую одежду и коронационное платье, облачения иерархов русской православной церкви, крупнейшее собрание золотых и серебряных изделий работы русских мастеров, западноевропейское художественное серебро, памятники оружейного мастерства, собрание экипажей, предметы парадного конского убранства."
